import React from "react";

const sumObj = props => {
  return (
    <div className="sumObj">
      <div>
        <form>
          <h3>Ihre Gesamtkosten:</h3>
          <ul>
            <li></li>
          </ul>
        </form>
      </div>
    </div>
  );
};

export default sumObj;
